    data: |
      SELECT DISTINCT + 51 - + col1 + col2, col2 + col0 / - + ( - + col0 ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 57 < - 69 + + ( - col0 );
  - name: tab2

outputs:
  - name: q1893.out
    data: |
      14	41
      23	24
      42	59
